function c(){const n="previousTabId",s=document.querySelectorAll('[fs-anchor-element="tab"]');if(s.length===0)return;const o=sessionStorage.getItem(n);s.forEach(t=>{const e=t.getAttribute("data-w-tab");if(o===e){const a=new CustomEvent("click");t.dispatchEvent(a)}t.addEventListener("click",()=>{e&&sessionStorage.setItem(n,e)})})}document.addEventListener("DOMContentLoaded",()=>{c()});
